INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('0002000001780', 'Pizza Margherita', 'Pâte* \'53.570 (farine de blé* , eau, sel, levure*), sauce tomate* 17% (purée de tomate* , oignon* sucre* , sel, ail* , origan* , basilic* , poivre* , persil* , concentré de tomate* , amidon de maïs , herbes de Provence*), mozzarella* 16% marinée à l\'huile d\'olive* et au basilic* 0.05%, emmental râpé* , tomates séchées marinées* 3.3% (tomates séchées* , huile de tournesol* , huile d\'olive extra vierge* , vinaigre de vin* , sel, ail* , persil* , basilic*), olives non dénoyautées*. Huile* infusée au piment* et au basilic*. Poids net 5g. *Ingrédients issus de l\'agriculture biologique Matières premières surgelées, produit à ne pas congeler. Les informations en gras sont destinées aux personnes intolérantes ou allergiques Produit élaboré dans un atelier qui utilise : des céréales contenant du gluten, des crustacés, des mollusques, des oeufs, du poisson, du soja, des graines de sésames, des fruits à coque et de la moutarde. CONSEIL DE PRÉPARATION Préchauffez votre four (200-2200C/TH7-8). Sortez votre pizza de son emballage film et carton. Lorsque votre four est chaud, enfournez votre pizza directement sur la grille à mi-hauteur pendant environ 10 minutes. Lorsque le fromage commencera à gratiner, sortez-la : votre pizza est prête ! L\'usage du four micro-ondes est déconseillé. AMUCL D\'A Lice', 'https://static.openfoodfacts.org/images/products/000/200/000/1780/front_fr.4.400.jpg', '10', '5', '30', '1', '', '12', '0.4', '0.15748031496063', '', '1');

